const AllTasks = (props) => {
    return(
        <div>
            {props.items.length === 0 ? (<P>Please Add some tasks. </P>) : (props.items.map((tasks => <TaskList key={tasks.id} id={tasks.id} title={tasks.task} deleteIndTask={props.delete} />)))};
            {/* {props.items.map((tasks => <TaskList key={tasks.id} id={tasks.id} title={tasks.task} deleteIndTask={props.delete} />))} */}
        </div>
    );
}

export default AllTasks;
